piranha.contentlist=new Vue({el:"#contentlist",data:{loading:!0,items:[],group:[],types:[]},methods:{bind:function(t){this.group=t.group,this.types=t.types,this.items=t.items.map(function(n){var i=t.types.find(function(t){return t.id===n.typeId});return n.type=i.title||n.typeId,n})},load:function(t){var n=this;piranha.permissions.load(function(){fetch(piranha.baseUrl+"manager/api/content/"+t+"/list").then(function(t){return t.json()}).then(function(t){n.bind(t),n.loading=!1}).catch(function(t){console.log("error:",t)})})}},created:function(){}});